import "./App.css";

function App() {
  return (
    <div className="pagina">
      <Esquerda />
      <div className="area-direita">
        <Topo />
        <Sistema setDados={setDados} />
        <Meio dados={dados} />
      </div>
    </div>
  );
}

export default App;
